import React,{ Component } from 'react';
import {Route} from 'react-router-dom';

class home extends Component{
	constructor(){
		super();
		this.state={
			userData:[]
		}
	}

	render(){
		return(
			<div>
				<p>this is home</p>
			</div>
		);
	}
}

export default home;
